import books from '../assets/data'

const BooksList = () => {
    return(
        <div>
            <div className='books-list'>
                {books.map(book => (
                    // <h3>{book.title}</h3>
                    // <h5>{book.id}</h5>
                    // <h6>{book.isbn}</h6>
                    <h5>{book.author.firstname}</h5>
                ))}
            </div>
        </div>
    )
}

export default BooksList;
